CREATE TABLE IF NOT EXISTS `#__getbible_country` (
  `id` smallint(1) unsigned NOT NULL AUTO_INCREMENT,
  `worldzone` tinyint(11) NOT NULL DEFAULT '1',
  `name` char(64) DEFAULT NULL,
  `codethree` char(3) DEFAULT NULL,
  `codetwo` char(3) DEFAULT NULL,
  `currency` char(3) DEFAULT NULL,
  `ordering` int(2) NOT NULL DEFAULT '0',
  `published` tinyint(1) NOT NULL DEFAULT '1',
  `user_created` int(11) NOT NULL DEFAULT '0',
  `user_modified` int(11) NOT NULL DEFAULT '0',
  `date_created` DATETIME NOT NULL,
  `date_modified` DATETIME NOT NULL,
  `checked_out` int(11) NOT NULL,
  `checked_out_time` DATETIME NOT NULL,
  PRIMARY KEY  (`id`),
  KEY `codethree` (`codethree`),
  KEY `codetwo` (`codetwo`)
) ENGINE=MyISAM AUTO_INCREMENT=249 DEFAULT CHARSET=utf8;


